import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-dom";
import Login from "./componets/Login";


function App() {
  return (
    <>
      <Route>
        <Switch>
          <Route path={'/login'} element={Login} />
        </Switch>
      </Route>
    </>
  );
}

export default App;
